import React,{Component} from 'react';
import './App.css';
import { connect } from "react-redux";
import editUserData from './actions/index';

function mapDispatchToProps(dispatch) {
  return {
    onClick: user => dispatch(editUserData(user)),
    type:'USER_UPDATED'
  };
}
export class UserItem extends Component{
	
   constructor(props){
   		super(props);
   }

    
  edit(evt){
    console.log(this.props.onClick)
  }
   render(){

    return(
            
     <div id='User' key={this.props.id} >
     <div id='header'>
      <label id='name'>{this.props.name.length <= 0 ? 'No Name' : this.props.name }</label>
      <label id='prof'>{this.props.job}</label>
     </div>
     <div id='email'>
      <label>{this.props.email.length <= 0 ? 'No Email' :this.props.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{this.props.bio.length <= 0 ? 'No Bio' : this.props.bio}</p>
     </div>
     </div>
     <button id="btn" onClick={() => this.edit()}>EDIT</button>
     </div>

    );

   }
  
}
export default connect(null,mapDispatchToProps)(UserItem);
